import Link from "next/link"

const Navbar = () => {
    const styles = {
        display: "flex",
        background: "green",
        alignItems: "space-between"
    }
    return (
        <div style={styles}>
            <Link href="/about"><button>About Page</button></Link>
            <Link href="/contact"><a>Contact Page</a></Link>
        </div>
    );
};

export default Navbar;
